var tipuesearch = {"pages": [{'title': 'About', 'text': 'members: \n 41023114 王樟皓 41023126 卓桓琮 \n 倉儲: \xa0 https://github.com/mdecd2023/2a-pj1ag12 \n 網站: \xa0 https://mdecd2023.github.io/2a-pj1ag12 \n', 'tags': '', 'url': 'About.html'}, {'title': 'W3', 'text': '\n', 'tags': '', 'url': 'W3.html'}, {'title': 'hw1', 'text': '\n 請各組寫一個程式判定 2a 哪一組已經完成網頁建置. \n 用Python的requests套件來進行網頁存取，並且查看網頁的回應狀態碼，判斷網頁是否存在。以下是一個可以判斷組別網頁建置狀態的Python程式： import requests \n base_url = "https://github.com/NTUT-2A/" \n # 迭代21個組別 for i in range(1, 22):  # 組別網頁的URL  url = base_url + f"2a-pj1ag{i}" \n # 建立 GET 請求  response = requests.get(url) \n # 判斷回應狀態碼是否為200  if response.status_code == 200:  print(f"2a-pj1ag{i} 已經完成網頁建置")  else:  print(f"2a-pj1ag{i} 尚未完成網頁建置") 程式會先以for迴圈迭代21個組別，然後使用requests.get()函式發送GET請求去查詢每一個組別的網頁狀態。如果回應狀態碼為200，代表網頁存在，組別已完成網頁建置；反之，如果回應狀態碼不是200，代表網頁不存在，組別尚未完成網頁建置。 \n \n \n \n', 'tags': '', 'url': 'hw1.html'}, {'title': 'hw2', 'text': 'Tutorial1-CoppeliaSim 4.3.0 User Manual - CoppeliaSim 4.3.0 使用者手冊  https://mde.tw/pjcopsim/content/bubbleRobTutorial.html   \n 心得, 展示頁面說明各組員所完成項目, 說明該組的專案規劃. \n stage 1 \n 模擬兩球相撞 \n \n  接下來將 mp4 檔案從 downloads 目錄取出  \n \n \n \n \n 模擬兩球相撞 \n https://youtu.be/WbUQO7bAOyA \n \n', 'tags': '', 'url': 'hw2.html'}, {'title': '程式note', 'text': 'python 相關資料 \n 參考來源: Python 教學 | STEAM 教育學習網 (oxxostudio.tw) \n', 'tags': '', 'url': '程式note.html'}, {'title': 'Requests 函式庫', 'text': 'requests 函式庫 ( 模組 ) 是相當流行的 Python 外部函式庫，透過 requests 能夠輕鬆抓取網頁的資料，這篇教學會介紹 requests 函式庫的基本用法。 \n https://steam.oxxostudio.tw/category/python/spider/requests.html \n', 'tags': '', 'url': 'Requests 函式庫.html'}, {'title': '重複迴圈 ( for、while )', 'text': '「for 迴圈」的使用的方法為「for 變數 in 可迭代的物件:」，執行之後，for 迴圈會依序將可以迭代的物件取出，賦值給指定的變數 。 \n https://steam.oxxostudio.tw/category/python/basic/loop.html \n', 'tags': '', 'url': '重複迴圈 ( for、while ).html'}, {'title': '補充note', 'text': '', 'tags': '', 'url': '補充note.html'}, {'title': '專案規劃', 'text': '專案規劃是一個系統性的過程，它包括了訂定目標、確定所需的資源、分配工作和責任、確定時間表、制定預算、風險評估和解決方案等。以下是一個簡單的專案規劃步驟： \n \n \n 確定目標：確定您要達成的目標是什麼。這可能包括確定任務、時程表、預算、資源、風險等。 \n \n \n 分析問題：分析問題，確定這個專案所需要的資源和限制，包括人力、財務、時間和技術方面的問題。 \n \n \n 制定計畫：制定一個計畫，詳細列出實現目標所需要的步驟，確定哪些工作需要完成以及誰將負責完成這些工作。 \n \n \n 資源分配：確定需要哪些資源以及如何分配這些資源。這可能包括人員、技術和設備等。 \n \n \n 建立時間表：建立一個時間表，確定各項工作和活動的時間表和完成期限。 \n \n \n 制定預算：制定一個預算，確定需要的財務資源和預算限制。 \n \n \n 風險評估：評估可能影響項目成功的風險，確定應對策略和解決方案。 \n \n \n 完成計畫：編制完整的計畫，包括上述所有步驟的詳細細節和時間表。 \n \n \n 經過上述步驟，專案規劃就完成了。一旦您完成了這些步驟，您就可以開始執行計畫，確保您的專案能夠順利進行並達成預期的目標。 \n', 'tags': '', 'url': '專案規劃.html'}]};